import { InnerPagesTopTitle } from "../../../../../common/InnerPagesTopTitle/InnerPagesTopTitle";
import { DarkBlueLinkBtn } from "../../../../../common/btn/Btn";
export const TrackingDelivery = () => {
  return (
    <>
      <div className="custom_container">
        <div className="user_managemen_top_title">
          <InnerPagesTopTitle name="Tracking of Delivery" />
        </div>
        <div className="inner_custom_container">
          <div className="row">
            <div className="col-12">
              <Contact />
            </div>
            <div className="col-12">
              <Maps />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
const Contact = () => {
  return (
    <>
      <div className="row">
        <div className="col-3">
          <div>
            <h1>On Going Job</h1>
          </div>
        </div>
        <div className="col-6">
          <div>
            <input type="email" className="form-control" />
          </div>
        </div>
        <div className="col-3">
          <div>
            <DarkBlueLinkBtn link="/tel:+4733378901" title="Call Now" />
          </div>
        </div>
      </div>
    </>
  );
};
const Maps = () => {
  return (
    <>
      <div className="my_maps_main_div">
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d7018.34368619124!2d77.0422939!3d28.4140712!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sin!4v1667446536436!5m2!1sen!2sin"
          className="my_maps"
          allowFullScreen=""
          loading="lazy"
          referrerPolicy="no-referrer-when-downgrade"
        ></iframe>
      </div>
    </>
  );
};
